import React from "react";

export default function ServiceCard (){
    return (
        <div class="service-card">
            <div class="service-icon text-teal">
                <svg xmlns="http://www.w3.org/2000/svg" class="h-8 w-8 mr-3" fill="none" viewBox="0 0 24 24" stroke="currentColor" stroke-width="2">
                    <path stroke-linecap="round" stroke-linejoin="round" d="M9 8h6m-5 4h8m-5 8h10M12 3a9 9 0 000 18h0a9 9 0 000-18z"></path>
                </svg>
                <h3>Loan &amp; Credit Management</h3>
            </div>
            <p>Easily manage your loans, track your credit score, and discover government schemes and NGOs that offer affordable loans.</p>
        </div>
    );
}
